import { AUTH,LOGOUT} from '../constants/actionTypes';
const authReducers=(state={audhData:null},action)=>{
    switch (action.type) {
        case AUTH:
        localStorage.setItem("profile",JSON.stringify({...action?.data}))
         return state;   
        default:
            return state;
    }
}
export default authReducers;
